import React from 'react';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    const [state, useState] = React.useState()
    return(
        <div>
            {gotoPrevPage && <button onClick={gotoPrevPage} disabled={gotoPrevPage ? null : true}>
                Previous Page
            </button>}
            {gotoNextPage && <button onClick={gotoNextPage} disabled={gotoNextPage ? null: true}>
                Next Page
            </button>}
        </div>
    )
}

export default Pagination;
